/** @format */

import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Nav from './components/Nav/Nav';

function Router() {
	return (
		<BrowserRouter>
			<Routes>
				<Route path='/nav' element={<Nav />} />
			</Routes>
		</BrowserRouter>
	);
}

export default Router;
